DROP DATABASE IF EXISTS zelos;
CREATE DATABASE IF NOT EXISTS zelos;
    
USE zelos;

-- Criar tabela usuarios
CREATE TABLE usuarios (
    id INT AUTO_INCREMENT PRIMARY KEY,
    numeroRegistro INT NOT NULL,
    nome VARCHAR(255) NOT NULL,
    email VARCHAR(255) NOT NULL UNIQUE,
    foto varchar(255),
    funcao VARCHAR(100) NOT NULL DEFAULT 'usuario',
    senha VARCHAR(255) NOT NULL, 
    descricao TEXT NOT NULL,
    status ENUM('ativo', 'inativo') DEFAULT 'ativo',
    criado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    atualizado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);
    
	CREATE TABLE duvidas (
    id INT AUTO_INCREMENT PRIMARY KEY,
    titulo VARCHAR(255) NOT NULL,
    descricao TEXT NOT NULL,
    autor varchar(150) NOT NULL,
    dataCriada TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    status_duvida ENUM('resolvido', 'pendente') default 'pendente'

    );

-- Criar tabela pool
CREATE TABLE pool (
	id INT AUTO_INCREMENT PRIMARY KEY,
	titulo ENUM('externo', 'manutencao', 'apoio_tecnico', 'limpeza') NOT NULL,
	descricao TEXT,
	status ENUM('ativo', 'inativo') DEFAULT 'ativo',
	criado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	atualizado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	created_by INT,
	updated_by INT,
	FOREIGN KEY (created_by) REFERENCES usuarios(id),
	FOREIGN KEY (updated_by) REFERENCES usuarios(id)
);

	-- Inserir registros no pool

    -- Criação da tabela `chamados`
CREATE TABLE chamados (
	id INT AUTO_INCREMENT PRIMARY KEY,
	titulo VARCHAR(255) NOT NULL,
	descricao TEXT NOT NULL,
	patrimonio TEXT NOT NULL,
	grau_prioridade ENUM('1', '2', '3', '4') DEFAULT '1',
	tipo_id INT,
	tecnico_id INT,
	usuario_id INT,	
	status ENUM('enviado', 'em andamento', 'concluído') DEFAULT 'enviado',
	criado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	atualizado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
	FOREIGN KEY (tipo_id) REFERENCES pool(id),
	FOREIGN KEY (tecnico_id) REFERENCES usuarios(id),
	FOREIGN KEY (usuario_id) REFERENCES usuarios(id) 
);

    -- Criação da tabela `apontamentos`
CREATE TABLE apontamentos (
	id INT AUTO_INCREMENT PRIMARY KEY,
	chamado_id INT NOT NULL,
	tecnico_id INT,
    usuario_id INT,
    admin_id INT,
	descricao TEXT,
	comeco TIMESTAMP NOT NULL,
	fim TIMESTAMP NULL,
	duracao INT AS (TIMESTAMPDIFF(SECOND, comeco, fim)) STORED,
	criado_em TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	FOREIGN KEY (chamado_id) REFERENCES chamados(id),
	FOREIGN KEY (tecnico_id) REFERENCES usuarios(id),
    FOREIGN KEY (usuario_id) REFERENCES usuarios(id)
);

    -- Criação da tabela `pool_tecnico`
CREATE TABLE pool_tecnico (
	id INT AUTO_INCREMENT PRIMARY KEY,
	id_pool INT,
	id_tecnico INT,
	FOREIGN KEY (id_pool) REFERENCES pool(id),
	FOREIGN KEY (id_tecnico) REFERENCES usuarios(id)
);

    -- Índices adicionais para otimização
CREATE INDEX idx_usuarios_email ON usuarios(email);
CREATE INDEX idx_chamados_status ON chamados(status);
CREATE INDEX idx_apontamentos_comeco_fim ON apontamentos(comeco, fim);

CREATE TABLE equipamentos (
    PATRIMONIO INT NOT NULL PRIMARY KEY,
    SALA VARCHAR(100) NOT NULL,
    EQUIPAMENTO VARCHAR(200) NOT NULL,
    AQUISICAO DATE NOT NULL,
    STATUS ENUM('Ativo', 'Inativo') NOT NULL DEFAULT 'Ativo',
    TIPO VARCHAR(50) NOT NULL,
    OBSERVACAO TEXT
);

